!function(){CKEDITOR.plugins.add("MediaEmbed",{init:function(e){CKEDITOR.dialog.add("MediaEmbedDialog",function(e){return{title:"Embed Media",minWidth:550,minHeight:200,contents:[{id:"iframe",expand:!0,elements:[{id:"embedArea",type:"textarea",label:"Paste Embed Code Here",autofocus:"autofocus",setup:function(){},commit:function(){}}]}],onOk:function(){for(var t=0;t<window.frames.length;t++)if("iframeMediaEmbed"==window.frames[t].name){window.frames[t].document.getElementById("embed").value}e.insertHtml(this.getContentElement("iframe","embedArea").getValue())}}}),e.addCommand("MediaEmbed",new CKEDITOR.dialogCommand("MediaEmbedDialog")),e.ui.addButton("MediaEmbed",{label:"Embed Media",command:"MediaEmbed",icon:this.path+"images/icon.png",toolbar:"mediaembed"})}})}();